  <>
    <div className={text-center}>
      <FontAwesomeIcon icon={faFacebook} className={'mb-0 mr-4 text-center text-4xl mt-12 mx-auto'}/>
      <FontAwesomeIcon icon={faInstagram} className={'mb-0 mr-4 text-4xl mt-12 mx-auto'}/>
    </div>
  </>
);

export default MediaSocial
